<script>
    
    var mapa_list = <?php echo json_encode($mapa_list); ?>;
    var galicia = <?php echo json_encode($galicia); ?>;
    var asturias = <?php echo json_encode($asturias); ?>;
    var pais_vasco = <?php echo json_encode($pais_vasco); ?>;
    var navarra = <?php echo json_encode($navarra); ?>;
    var aragon = <?php echo json_encode($aragon); ?>;
    var cataluna = <?php echo json_encode($cataluna); ?>;
    var valencia = <?php echo json_encode($valencia); ?>;
    var castilla_mancha = <?php echo json_encode($castilla_mancha); ?>;
    var murcia = <?php echo json_encode($murcia); ?>;
    var rioja = <?php echo json_encode($rioja); ?>;
    var castilla_leon = <?php echo json_encode($castilla_leon); ?>;
    var extremadura = <?php echo json_encode($extremadura); ?>;
    var andalucia = <?php echo json_encode($andalucia); ?>;
    var madrid = <?php echo json_encode($madrid); ?>;
    var baleares = <?php echo json_encode($baleares); ?>;
    var canarias = <?php echo json_encode($canarias); ?>;
    var comunidades = {'galicia':galicia,'asturias':asturias,'pais_vasco':pais_vasco,'navarra':navarra,'aragon':aragon,'cataluna':cataluna,'valencia':valencia,'castilla_mancha':castilla_mancha,'murcia':murcia,'rioja':rioja,'castilla_leon':castilla_leon,'extremadura':extremadura,'andalucia':andalucia,'madrid':madrid,'baleares':baleares,'canarias':canarias};

    var interval = <?php echo json_encode($interval); ?>;

    var count_mapa = 0;

    var fill_map_id_total = ['Fill-5','Fill-3','Fill-7','Fill-9','Fill-11','Fill-13','Fill-15','Fill-17','Path','Fill-21','Fill-23','Vasque-Country','Fill-27','Fill-29','Fill-31','Fill-33','Fill-35'];

    for(var j=0; j<fill_map_id_total.length;j++){
        $("#"+fill_map_id_total[j]).addClass('animate');
    }

    /* function that calls the Twitter API and retrives the information from the tweet (name, tweet, photo and location) and changes the color of the region in the map and shows the tweet */

    function getTwitterCallMapa(){
        if(count_mapa > (mapa_list.length -1)){
            count_mapa = 0;
        }
        search_term = mapa_list[count_mapa];

        jQuery.ajax({
            type: "GET",
            fill_map_id_total:fill_map_id_total,
            url: "app/showTweets.php",
            data: {function: 'callTwitterAPI', search: search_term},
            dataType: "json",
            success: function(response){
                console.log(response);
                var result = response['statuses'];
                if(result.length == 0){
                    count_mapa ++;
                    getTwitterCallMapa();
                }

                $('#header-subtitle').empty();
                $('#mapa-tweet').empty();
                var title = "<h2>"+search_term+"</h2>";
                $('#header-subtitle').append(title);
                var fill_map_id_total = this.fill_map_id_total;

                var tweet = result[0];

                var text = tweet['text'];
                var name = tweet['user']['name'];
                var screen_name = tweet['user']['screen_name'];
                var profile_image = tweet['user']['profile_image_url_https'];
                var created_at =tweet['created_at'];
                created_at = new Date(created_at);
                created_at = created_at.getDate() + "/" + (created_at.getMonth()+1);
                var location = tweet['user']['location'];
                var location_code;

                // si no devuelve nada, por defecto mostramos madrid
                    if(location.length == 0){
                        location_code = "madrid";
                    }else{
                    location = location.toLowerCase();
                    
                    for(comunidad in comunidades){
                        var comunidad_list = comunidades[comunidad];

                        for(i=0;i<comunidad_list.length;i++){
                            var match_elem = new RegExp( comunidad_list[i], 'g' );
                            if(location.match(match_elem) != null){
                                location_code = comunidad;

                                break;
                            }else{
                                location_code ="";
                            }
                        }

                        if(location_code.length != 0){
                            break;
                        }
                    }
                    if(location_code.length == 0){
                        location_code = "cataluna";
                    }
                    }

                    var fill_map_id = "";

                    switch(location_code){
                        case 'galicia':
                        fill_map_id ="Fill-13";
                            break;
                        case 'asturias':
                        fill_map_id ="Fill-29";
                            break;
                        case 'cantabria':
                        fill_map_id ="Fill-23";
                            break;
                        case 'pais_vasco':
                        fill_map_id ="Vasque-Country";
                            break;
                        case 'navarra':
                        fill_map_id ="Fill-7";
                            break;
                        case 'aragon':
                        fill_map_id ="Fill-31";
                            break;
                        case 'cataluna':
                        fill_map_id ="Fill-17";
                            break;
                        case 'rioja':
                        fill_map_id ="Fill-5";
                            break;
                        case 'castilla_leon':
                        fill_map_id ="Path";
                            break;
                        case 'madrid':
                        fill_map_id ="Fill-11";
                            break;
                        case 'extremadura':
                        fill_map_id ="Fill-15";
                            break;
                        case 'castilla_mancha':
                        fill_map_id ="Fill-21";
                            break;
                        case 'valencia':
                        fill_map_id ="Fill-3";
                            break;
                        case 'baleares':
                        fill_map_id ="Fill-27";
                            break;
                        case 'murcia':
                        fill_map_id ="Fill-9";
                            break;
                        case 'andalucia':
                        fill_map_id ="Fill-33";
                            break;
                        case 'canarias':
                        fill_map_id ="Fill-35";
                            break;
                        default:
                        fill_map_id ="Fill-17";


                    }


                    var elem = "<div class='row h-100 w-100'><div class='col-2'><img alt='' src='"+profile_image+"' width='25' height='25'></div><div class='col-10'><h4 style='float:left;font-size:16px;'>"+screen_name+"</h4><span style='float:left;position:relative;left:10px;bottom:-4px'>"+search_term+"</span><div style='clear:left;'></div><p>"+text+"</p></div><div class='fecha-tweet-mapa'></div></div>";

                    $('#mapa-tweet').append(elem);

                    for(var j=0; j<fill_map_id_total.length;j++){
                        $('#'+fill_map_id_total[j]).attr('fill','#0D3253');
                    }

                    setTimeout(function(){ $('#'+fill_map_id).attr('fill','url(#linearGradient-1)') }, 500);

            },
            error: function(XMLHttpRequest, textStatus, errorThrown) {
                console.log("Status: " + textStatus); console.log("Error: " + errorThrown);
            }
            });

            count_mapa ++;

    }

    /* call the function a first time */
    getTwitterCallMapa();

   /* call the function every X seconds */

    setInterval(function(){getTwitterCallMapa();},interval); 

    </script>
